            { "open", "open" },
            { "filled", "closed" },
            { "match", "open" },
            { "update", "open" },
            { "canceled", "canceled" },
            { "cancel", "canceled" },
            { "TRIGGERED", "triggered" },
        };
        return this.safeString(statuses, status, status);
    }

    public override object parseWsOrder(object order, object market = null)
    {
        //
